}


</code></pre>; Answer: @Cheersandhth.-Alf Compressed pairs are used for example in the implementation of `unique_ptr` to get rid of the space for the deleter; similarly, they can be used to get rid of the space for allocators in containers. In containers, there can be multiple potentially stateless objects like comparison function objects etc. Vectors of `unique_ptr`s and so on might be a more realistic example of where such optimization makes sense; also considering memory-bound algorithms. Unfortunately, it seems to make it much harder for the compiler to optimize the code, e.g. for assignment.

