How to find the most repeated value in arrays of MongoDB/Mongoose documents?<p>Let's say I have a collection with documents looking like this:</p>
<pre><code>[
 {
    &quot;username&quot;: &quot;user123&quot;,
    &quot;email&quot;: &quot;user@123.com&quot;,
    &quot;favourites&quot;: [
      {
        &quot;location_name&quot;: &quot;USA&quot;,
        &quot;id&quot;: &quot;10&quot;,
        &quot;day&quot;: &quot;19&quot;,
        &quot;month&quot;: &quot;7&quot;
