  {
    &quot;username&quot;: &quot;user2&quot;,
    &quot;email&quot;: &quot;user@53.com&quot;,
    &quot;favourites&quot;: [
      {
        &quot;location_name&quot;: &quot;USA&quot;,
        &quot;id&quot;: &quot;10&quot;,
        &quot;day&quot;: &quot;19&quot;,
        &quot;month&quot;: &quot;7&quot;
