How to convert javascript array to Mongodb Shell syntax?<p>In our team we are building an API, where we use Mongodb aggregation pipelines to respond. We build these pipelines rather dynamically, depending on the incoming filters. This makes it a bit hard to debug with for example MongoDB Compass. My idea is therefore to debug the aggregation pipeline in Compass, but importing a pipeline requires the pipeline to be in &quot;MongoDB Shell syntax&quot;.</p>
<p><strong>Can I convert a javascript array (containing an aggregation pipeline) to a string of format &quot;MongoDB Shell syntax&quot;</strong>?</p>
<p>I tried with JSON.stringify, but that obviously does not work. If I could the array as MongoDB Shell syntax, I could paste it here:</p>
<p><a href="https://i.stack.imgur.com/KHjYO.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/KHjYO.png" alt="enter image description here" /></a></p>
<p>And debug the pipeline step by step :)</p>
<p><strong>Example</strong> pipeline could be:</p>
<pre class="lang-js prettyprint-override"><code>function buildPipeline(groupId: string, factoriesToFilter?: string[]) {
    const pipeline = [
        {
            $match: {
                ...(factoriesToFilter &amp;&amp; {
                    _id: {
                        $in: factoriesToFilter.map((v) =&gt; new ObjectId(v)),
                    },
                }),
                groupId,
                ...(!factoriesToFilter &amp;&amp; {
                    status: 'active',
                }),
            },
        }
    ];
}
</code></pre>
<p>Expected output when called with <code>buildPipeline('abc')</code>:</p>
<pre><code>[
{
  $match: {
    groupId: 'abc',
    status: 'active'
  }
}  
]

</code></pre>
<p>Turns out the solution was just to JSON.stringify after all..</p>

